import { makeStyles, Theme } from "@material-ui/core/styles";

const useStyles = makeStyles((theme: Theme) => ({
    root: {
        width: "100%",
        height: "100vh",
        display: "flex",
        flexDirection: "column" as const,
        justifyContent: "center",
        [theme.breakpoints.up("md")]: {
            alignItems: "center",
        },
    },
    paper: {
        borderRadius: "12px",
        display: "flex",
        alignItems: "center",
        flexDirection: "column",
        width: `calc(100vw - ${theme.spacing(6)}px)`,
        height: "100%",
        padding: theme.spacing(3),
        position: "relative",
        [theme.breakpoints.up("md")]: {
            height: "initial",
            width: "30vw",
            minHeight: "380px",
        },
    },
    actionButtons: {
        display: "flex",
        flexDirection: "row",
        alignItems: "center",
        justifyContent: "space-between",
        width: "100%",
        "&>button": {
            background: "none",
            border: "none",
            cursor: "pointer",
            outline: "none"
        }
    }
}));

export default useStyles;
